import {useTable} from 'react-table';


const Main = () => {
    // const {workouts, dispatch} = useWorkoutsContext();
    const {user} = useAuthContext();
    const response = fetch('/api/user', {
        method: 'FETCH',
        headers: {'Authorization': `Bearer ${user.token}`}
    })
    // useEffect(() => {
    //     const response = fetch('/api/user', {
    //         method: 'FETCH',
    //         headers: {'Authorization': `Bearer ${user.token}`}
    //     })
    // }, [user]);

    return ( 
        <div className="main">
            {response.map((user)=>{
                <div className="user">
                    {user._id}
                </div>
            })}
        </div>
    );
}
 
export default Main;
